import { Box, Button, Container, styled, TextField, Typography } from "@mui/material";

const CreatePollContainer = styled(Container)(({ theme }) => ({
    paddingTop: theme.spacing(10),
    height: '100%',
    overflow: 'auto'
}));

const CreatePollPage = () => {
    return (
        <CreatePollContainer>
            <Typography variant="h4">Create a poll</Typography>
            <Box
                sx={{
                    width: 500,
                    maxWidth: '100%',
                    display: 'flex',
                    marginTop: 10
                }}
            >
                <TextField fullWidth label="Add a position" id="fullWidth" sx={{marginRight: '10'}} />
                <Button variant="contained" >Add post</Button>
            </Box>
        </CreatePollContainer>
    );
};

export default CreatePollPage;
